import React from 'react';
import styled from 'styled-components';
import { Container, Col, Row } from 'react-grid-system';




interface Props { }

const Landing: React.FunctionComponent<Props> = () => {

  return (
    <Main>

      <Container>
        <ContentWrapper>
          <div className="top">
            <a href="/"><img src="logo.svg" /></a>
            <Box className="box-top-right-border"></Box>
          </div>
          <div className="bottom">
            <Box className="box-bottom-left-border"></Box>
            <div className="social">social</div>
          </div>
        </ContentWrapper>
      </Container>
      <div className="mid">
            <div className="main-text">
              <div>Puskal</div>
              <div>Design</div>
            </div>
          </div>
    </Main>
  );
};
const Main = styled.main`
.mid{
  // background: lightcoral;
  justify-content: center;
  font-size:150px;
  font-weight:bold;
  text-transform: uppercase;
  position: fixed;
  left: 50%;
  top: 50%;
  transform: translate(-50%,-50%);
  .main-text {
    // position: absolute;
    // left: auto;
    // top: auto;
    // transform: translateY(-25%);
}
  .main-text>div:last-child{
    position: relative;
    transform: translateY(-61%);
    background: ${({ theme }) => theme.colors.primary.light};
    line-height: 100px;
    letter-spacing: -1.7px;
  }
}
`;
const ContentWrapper = styled.div`
// height:100vh;
display:flex;
flex-direction:column;
justify-content: space-aroung;
// padding:${({ theme }) => theme.spacing.xxxl} 0;
&>div{
  display:flex;
  justify-content:space-between;
  // flex: 1;
  height:50vh;
  max-height:50vh;
  min-height:50vh;
  &.top{
    // padding-top:${({ theme }) => theme.spacing.xxxl};
    // background: lightblue;
  }
  &.bottom{
    // padding-bottom:${({ theme }) => theme.spacing.xxxl};
    // background: lightgrey;
    align-items: flex-end;
  }

}
`;
const Box = styled.div`
    max-width:25vh;
    height:25vh;;
    border:1px solid rgba(4,17,26,.2);
    &.box-top-right-border{
      border-bottom:none;
      border-left:none;
    }
    &.box-bottom-left-border{
      border-top:none;
      border-right:none;
    }
`;


export default Landing;
